import{_ as e,o as r,c as t,O as a}from"./chunks/framework.9482e208.js";const _=JSON.parse('{"title":"§ 19.2-386.17 Forfeitures for computer crimes.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/19.2-386.17.md","filePath":"vacode/19.2-386.17.md"}'),o={name:"vacode/19.2-386.17.md"},i=a('<h1 id="§-19-2-386-17-forfeitures-for-computer-crimes" tabindex="-1">§ 19.2-386.17 Forfeitures for computer crimes. <a class="header-anchor" href="#§-19-2-386-17-forfeitures-for-computer-crimes" aria-label="Permalink to &quot;§ 19.2-386.17 Forfeitures for computer crimes.&quot;">​</a></h1><p>All moneys and other income, including all proceeds earned but not yet received by a defendant from a third party as a result of the defendant&#39;s violations of Article 7.1 (§ <a href="http://law.lis.virginia.gov/vacode/18.2-152.1/" target="_blank" rel="noreferrer">18.2-152.1</a> et seq.) of Chapter 5 of Title 18.2, and all computer equipment, all computer software, and all personal property used in connection with any violation of such article known by the owner thereof to have been used in violation of such article, shall be subject to lawful seizure by a law-enforcement officer and forfeiture by the Commonwealth in accordance with the procedures set forth in Chapter 22.1 (§ <a href="http://law.lis.virginia.gov/vacode/19.2-386.1/" target="_blank" rel="noreferrer">19.2-386.1</a> et seq.) of this title, applied mutatis mutandis.</p><p>2003, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?031+ful+CHAP0987" target="_blank" rel="noreferrer">987</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?031+ful+CHAP1016" target="_blank" rel="noreferrer">1016</a>, § 18.2-152.16; 2004, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?041+ful+CHAP0995" target="_blank" rel="noreferrer">995</a>.</p>',3),n=[i];function l(c,s,f,p,d,h){return r(),t("div",null,n)}const m=e(o,[["render",l]]);export{_ as __pageData,m as default};
